const questionData = [
  {
    id: 1,
    text: "나는 사람들 앞에서 드러내기보다는 혼자 생각을 정리하는 편이다.",
    keywords: ["내향성", "사색"]
  },
  {
    id: 2,
    text: "관계 속에서 신뢰와 안전이 깨질까 봐 걱정이 먼저 든다.",
    keywords: ["신뢰", "불안"]
  },
  {
    id: 3,
    text: "계획 없이 충동적으로 행동하다가 일을 수습하느라 힘들 때가 있다.",
    keywords: ["충동", "수습"]
  },
  // ...(중간 생략: 전체 45문항으로 구성됨)
  {
    id: 45,
    text: "내 감정과 경험을 말로 표현하면 진짜 내가 드러나는 것 같다.",
    keywords: ["표현", "진정성"]
  }
];

export default questionData;
